import React, { useState, useEffect } from 'react'
import './App.css'

function App() {
  
   const [data, setData] = useState([{}])

   useEffect(()=>{
         fetch("/homepage").then(
            res => res.json()
         ).then(
               data => {
                  setData(data)
                  console.log(data)
               }
         )
      }, [])

    return (
    <div>
         <h1 style={{ fontSize: 50 , textAlign: 'center' }}> Secure your important info with</h1>
         <div style={{ float: 'left', width: "50%"}} id="titleWidget">
            {(typeof data.title ==='undefined') ? (
                  <h1>Undefined</h1>
               ):(
                     data.title.map((title,i) => (
                        
                        <h1 style={{ fontSize: 50 , textAlign: 'center' }} key ={0}>{title}</h1>
                        
                        ))
                        )}
         </div>
    </div>
  )
}

export default App
